css:
@-moz-document domain("www.tumblr.com") {

/* blue fix */
div.search_form_row {background-color: rgba(128, 82, 255, 0.43)}
div.l-header .selection_nipple {border-bottom-color: rgba(128, 82, 255, 0.43)}

#left_column, #right_column {
	background-color: transparent;
}
.controls_section.user_list li.item .follow_list_item_blog:before {
  background-image: none;
  border-right: none;
  }
.radar div.radar_footer .radar_avatar:before {
  background-image: none;
  }
#right_column:after {display:none}

body:not(.mceContentBody) {
  background: url('data:image/jpeg;base64,') center fixed repeat !important;
}
div.l-content.l-content.l-content.l-content {background-color: transparent}
#right_column {
  background-color: rgba(128,82,255,.43);
  border-radius: 12px;
}
div.search_form_row {background-color: rgba(128,82,255,.43)}

/* remove blue fuzz */
.controls_section.user_list li.item .follow_list_item_blog:before {
  background-image: none;
  border-right: none;
  }
.radar div.radar_footer .radar_avatar:before {
  background-image: none;
  }
#right_column:after {display:none}

}
